Автомоби́льная промы́шленность (автомобилестрое́ние) — отрасль промышленности, осуществляющая производство безрельсовых транспортных средств (автомобилей), преимущественно с двигателями внутреннего сгорания (ДВС). Частично — включает в себя подотрасли: 
*  моторостроение; 
*  производство комплектующих (важнейшее — шинная промышленность); 
*  производство технологического оборудования (станкостроение и роботостроение); В автомобилестроении велика доля капитальных затрат, а также расходов на рабочую силу, хотя её квалификация не столь важна, как, например, в авиастроении или энергетической промышленности. Автомобилестроение с самого зарождения в конце XIX века было крупным потребителем продукции чёрной металлургии — холоднокатаного листа, отливок из чугуна и стали и т. д.; цветной металлургии — производство радиаторов, карбюраторов, арматуры и т. д.; химической промышленности — резиновые (прежде всего шины) и пластмассовые изделия, красители и т. д.; электротехнической — системы зажигания, аккумуляторные батареи, генераторы, стартеры, электропроводка, системы освещения; стекольной промышленности. Именно в автомобилестроении с середины 1910-х годах получила самое широкое распространение конвейерная система сборки (см. Генри Форд), революционизировавшая индустрию XX века.
